import React from "react";
import "../../App.css";
import Aos from "aos";
import "aos/dist/aos.css";
import { useEffect } from "react";
import { Container, Grid, Box } from "@material-ui/core";
import r1 from "../pages/SyImg/proimg/1-150x150.jpeg";
import r11 from "../pages/SyImg/proimg/1-650x650.jpeg";
import r2 from "../pages/SyImg/proimg/2-150x150.jpeg";
import r22 from "../pages/SyImg/proimg/2-650x650.jpeg";
import r3 from "../pages/SyImg/proimg/3-150x150.jpeg";
import r33 from "../pages/SyImg/proimg/3-650x650.jpeg";

import {
  Magnifier,
  GlassMagnifier,
  SideBySideMagnifier,
  PictureInPictureMagnifier,
} from "react-image-magnifiers";

export default function Products() {
  useEffect(() => {
    Aos.init({ duration: 2000 });
    Aos.refresh();
  }, []);

  return (
    <div>
      <div className="urunler"></div>
      <Container>
        <Grid container spacing={8} direction="row">
          <Grid item xs={12} md={4} xl={3} data-aos="fade-up" m={2}>
            <Box style={{ width: "300px", height: "auto", margin: "5%" }}>
              <PictureInPictureMagnifier
                imageSrc={r11}
                imageAlt="Example"
                largeImageSrc=""
              />
            </Box>
          </Grid>
          <Grid item xs={12} md={4} xl={3} data-aos="fade-up" m={2}>
            <Box style={{ width: "300px", height: "auto" }}>
              <PictureInPictureMagnifier
                imageSrc={r22}
                imageAlt="Example"
                largeImageSrc={r22}
              />
            </Box>
          </Grid>
          <Grid item xs={12} md={4} xl={3} data-aos="fade-up" m={2}>
            <Box style={{ width: "300px", height: "auto" }}>
              <PictureInPictureMagnifier
                imageSrc={r33}
                imageAlt="Example"
                largeImageSrc={r33}
              />
            </Box>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
}
